import React from 'react'

function Home() {
    return (
        <div className='kato' >
            <div class="card border-0">
                <img src="assets/bg.jpg" class="card-img" alt="background" height="550px" />
                <div class="card-img-overlay">
                    
                </div>
            </div>

        </div>
    );
};

export default Home
